    "sid": "40911",
    "Technique ID": "T1071.001",
    "Technique Name": "Malicious Web Site Content Compromise",
    "Quotes": [
      "http_raw_uri; bufferlen:11; http_uri; content:\"/search.php\",fast_pattern,nocase;"
    ],
    "Explanation": "The Snort rule is detecting a malicious outbound connection to a compromised website (/search.php), which is indicative of the Malicious Web Site Content Compromise technique where an adversary compromises a legitimate web server and uses it to host malicious content."
  },
  {
    "sid": "40911",
    "Technique ID": "T1071",
    "Technique Name": "Application Layer Protocol",
    "Quotes": [
      "http_client_body; content:\"as_ft=\"; content:\"as_q=\";"
    ],
    "Explanation": "The Snort rule is inspecting the HTTP client body for specific content (as_ft= and as_q=), which suggests the use of the Application Layer Protocol technique where an adversary communicates using an application layer protocol like HTTP to avoid detection/network-level filtering."
  }
]', type='text')]

