[TextBlock(text='[
  {
    "sid": "46070",
    "Technique ID": "T1071.001",
    "Technique Name": "Malicious Web Site Content Viewing",
    "Quotes": [
      "content:\"Expect: 100-continue\",fast_pattern,nocase;",
      "http_client_body; content:\"id=\",depth 3; content:\"&pc=\";"
    ],
    "Explanation": "The Snort rule is designed to detect outbound HTTP requests from a compromised system to an external network, which could be indicative of malware attempting to exfiltrate data or receive commands from a remote server. The rule looks for specific patterns in the HTTP headers and body, suggesting that it is targeting malicious web content viewing or data exfiltration via HTTP."
  },
  {
    "sid": "46070",
    "Technique ID": "T1071",
    "Technique Name": "Application Layer Protocol",
    "Quotes": [
      "alert tcp $HOME_NET any - $EXTERNAL_NET $HTTP_PORTS",
      "service:http;"
    ],
    "Explanation": "The Snort rule is specifically targeting HTTP traffic, which is an application layer protocol. The rule is designed to detect malicious activity occurring over the HTTP protocol, such as data exfiltration or command and control communication."
  }
]', type='text')]

